import {css, html, LitElement} from 'lit'
import {Update} from "../wailsjs/go/drawer/Api"
import {GetBoard, FromBase64} from "../wailsjs/go/main/ImgBase64"
import {customElement, property} from 'lit/decorators.js'

import {styleMap} from 'lit/directives/style-map.js';
import './style.css';

@customElement('image-board')
export class ImageBoard extends LitElement {
    X = 0
    Y = 0

    static styles = css`
        #draw-image {
            position: absolute;
        }

        #image-setter {
            position: absolute;
            left: 500px;
            top: 630px;
            border: 2px dotted;
            border-radius: 2px;
        }
    `

    @property()
    imgSrc = ""

    @property()
    errMsg = ""

    setImage() {
        let elem = this.shadowRoot?.getElementById('imageInput') as HTMLInputElement;
        if (elem == null) return ;
        let files = elem.files;
        if (files == null) return ;
        let img = files[0];

        const reader = new FileReader();
        reader.readAsDataURL(img);
        reader.onload = () => {
            if (reader.result == null) return ;
            const res = (reader.result as string).split(",")[1];
            FromBase64(res).then((msg) => {
                this.errMsg = msg == "" ? "OK !" : msg;
            });
        }
    }

    render() {
        var img = ""
        const imageStyles = styleMap({ left: `calc(10px + ${this.X}px)`, top: `calc(10px + ${this.Y}px)` })
        if (this.imgSrc != "") {
            img = `<img src='${this.imgSrc}' id='draw-image' style=${imageStyles}></img>`
        }

        return html`
            ${img}
            <div id="image-setter">
                <p>${this.errMsg}</p>
                <input type="file" id="imageInput" accept="image/png, image/jpeg" />
                <button @click=${this.setImage}>设置图片</button>
            </div>
        `
    }
}

@customElement('paint-board')
export class PaintBoard extends LitElement {
    static styles = css`
    .paint-board {
        position: absolute;
        left: 10px;
        top: 10px;
    }
    #board {
    width: 1000px;
    height: 600px;
    }
    `
    timerID = -1

    @property()
    flushInterval = 30

    @property()
    flushStatus = 0

    updateBoard() {
        console.log("In Update...");
        this.flushStatus = 1;
        Update().then(() => {
            this.flushStatus = 2;
            GetBoard().then((data) => {
                this.flushStatus = 3;
                this.imageData = data;
            })
        })
    }

    startTimer() {
        this.updateBoard();
        this.timerID = setInterval(this.updateBoard, this.flushInterval * 1000);
        console.log("timer start, ID", this.timerID);
    }

    changeInterval() {
        let inter = (this.shadowRoot?.getElementById('interval') as HTMLInputElement)?.value;
        console.log(inter);
        if (inter) {
            if (this.timerID != -1) {
                clearInterval(this.timerID);
            }
            this.flushInterval = parseInt(inter);
            this.startTimer();
        }
    }

    render() {
        var stat = "刷新未开始";
        var msg = "开始刷新";
        if (this.flushStatus != 0) {
            msg = "更新刷新间隔";
        }

        if (this.flushStatus == 1) {
            stat = "正在读取数据";
        } else if (this.flushStatus == 2) {
            stat = "正在编码图像";
        } else if (this.flushStatus == 3) {
            stat = "刷新成功！";
        }
        return html`
        <div class="paint-board">
            <img id="board" src="data:image/png;base64,${this.imageData}">
            <p>当前刷新间隔：${this.flushInterval} 秒 </p>
            <p>${stat}</p>
            <div class="interval-setter">
                <input class="interval-input" id="interval" type="number" value="${this.flushInterval}"/>
                <button @click=${this.changeInterval} >${msg}</button>
            </div>
        <div>
        `
    }

    @property()
    imageData = ``
}
